import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let siteData = this.props.siteData;
    return (
      <section id="about">
         <div className="row">

            <div className="nine columns main-col">

               <h2>Who Jim Was:</h2>
               <p>
               {
                 siteData.aboutme
               }
               </p>

               <h2>His Journey</h2>
               <p>
               {
                 siteData.aboutme
               }
               </p>

               <div className="row">

                  <div className="columns contact-details">

                  <h2>His Journey</h2>
                  <p className="address">
       						<span>{siteData.Journey}</span>
                     <br></br>
       						   <span>
                     {siteData.Journey}
                    </span>
                    <br></br>
                    <span>{siteData.Journey}</span>
       					   </p>
                  </div>
               </div>
            </div>
         </div>
      </section>
    );
  }
}
